import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 32.1-162.29 Form and audit of accounts and records.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-162.29.md","filePath":"vacode/32.1-162.29.md"}'),o={name:"vacode/32.1-162.29.md"},n=t('<h1 id="§-32-1-162-29-form-and-audit-of-accounts-and-records" tabindex="-1">§ 32.1-162.29 Form and audit of accounts and records. <a class="header-anchor" href="#§-32-1-162-29-form-and-audit-of-accounts-and-records" aria-label="Permalink to &quot;§ 32.1-162.29 Form and audit of accounts and records.&quot;">​</a></h1><p>A. The accounts and records of the Board showing the receipt and disbursement of funds from whatever source derived shall be in such form as the Auditor of Public Accounts prescribes.</p><p>B. The accounts and records of the Board are subject to an annual audit by the Auditor of Public Accounts or his legal representative.</p><p>1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0803" target="_blank" rel="noreferrer">803</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0888" target="_blank" rel="noreferrer">888</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0891" target="_blank" rel="noreferrer">891</a>, § 23-285; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),c=[n];function i(s,d,l,f,u,_){return a(),r("div",null,c)}const g=e(o,[["render",i]]);export{p as __pageData,g as default};
